const declarativeCode = '<Paginator noOfPages={5} isControlled onChange={(...args) => console.log(...args)} />';

const eventsCode = '<Paginator noOfPages={5} onChange={(...args) => console.log(...args)} />';

const simpleCode = '<Typeahead suggestions={suggestions} />';

